import './App.css';
import { useState } from 'react';

const App = () => {
  const [Counter, setCounter] = useState(0);

  return (
    <div className="App" style="">
      <button onClick={() => setCounter((prevCount) => prevCount - 1)}>-</button>
      <h1>{Counter}</h1>
      <button onClick={() => setCounter((prevCount) => prevCount + 1)}>+</button>
    </div>
  );
}

export default App;
